Продаю настольные игры. Упаковка за мой счёт. Отправка за счёт покупателя. Отправка по полной предоплате на карту Сбербанка. Дополнительные фото по запросу. Все вопросы в личку, комментарии могу не увидеть. Имеются положительные отзывы покупателей. 

1) Nauticus (от Kosmos). Игра от легендарного дуэта Михаэля Кислинга и Вольфганга Крамера про строительство кораблей. В идеале. Правила на русском языке на оригинальном буклете, распечатанные в типографии прилагаются – 2500 рублей;
2) My Village (Моя деревня). Игра от Инки и Маркуса Бранда (Раджи Ганга, Летопись). Коробка внизу незначительно потёрта. Внутри всё в идеале. Правила на русском языке на оригинальном буклете, распечатанные в типографии прилагаются – 2500 рублей;
3) Newton. Игра от Симоне Лучани (Марко Поло, Голем, Плотина). Коробка внизу незначительно потёрта. Внутри всё в идеале. Издание на английском языке + Две Промокарты: Robert Hooke и Stephen Hawking – 3000 рублей;
4) Покорение Марса. Экспедиция «Арес». В идеале. Одна недоигранная партия на двоих. Плюс 17 Промокарт с предзаказа - 2500 рублей.
